  \"2013-03-16T01:23:35.484614\",\n\t\"name\": \"new-mexico-borehole-lithology-intercepts\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset contains borehole lithology
  intercept observations compiled by the New Mexico Bureau of Geology and Mineral
  Resources, and published as a Web feature service for the National Geothermal Data
  System. Fields in the Borehole Lithology Intercept Content Model will become XML
  elements in interchange documents for WMS simple features provided by a node in
  the USGIN network. Each feature includes a well name, well type, status, lithology
  at some intercept and latitude and Longitude spatially referenced to EPSG: 4326
  (for interoperability). The data contained in the submitted dataset is available
  as an Excel Spreadsheet, ESRI service, WMS and WFS service. Link to Borehole Observation
  Content Model: Currently Not Online. \",\n\t\"license_title\": null,\n\t\"extras\":
